import React, { Component } from 'react'
import { style_mapping } from "../styled";

const {
    layout: { ContentBlockContainer }
} = style_mapping;

class ContentBlock extends Component {
  render() {
    return (
      <ContentBlockContainer>
        <h1>Hey</h1>
        <hr/>
        <p>Lorem Ipsum</p>
      </ContentBlockContainer>
    )
  }
}

export default ContentBlock
